import "./style/index.scss"
import Header from "./components/Header.js";
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Header />
      <p>Hello world! Ho </p>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/about" element={<About />} />
          <Route path="*" element={<Home />} />
          {/*Ceci est un commentaire*/}
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
